import React, { Component } from 'react';
//import { Jumbotron } from 'react-bootstrap';
import homePagePhoto from '../images/homepage-test-1.webp';
import { Jumbotron } from 'react-bootstrap';

class HomePage extends Component {
    state = {}
    render() {
        return (
            <Jumbotron fluid>
                <img
                    src={homePagePhoto}
                    alt="Savings Bonds"
                />
            </Jumbotron>
        )
    }
}

export default HomePage;
